/**
 * Create a footer in the style of V2.
 * @param {*} prop
 */
import React from "react";
import Home from "./homeActive.png"

function Footer(prop) {
    return( <footer>
           <table className="FooterLayout">
           <tbody>
           <tr>
              <td><a className="FooterLayout" href="./2/login">Login</a></td>
              <td ><img className="icon" src={Home} alt=""/></td>
              <td><a href="./create">Create Account</a></td>
          </tr>
          </tbody>
          </table>
          </footer> );
}

export default Footer;
